import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App'

import './index.css';
class Users extends React.Component {
  render () {
    const id = this.props.params.userId;
    console.log(id)
    return (
      <div>
        user id: {id}
      </div>
    )
  }
}

ReactDOM.render(
  <React.strickmode>
    <App />
  </React.strickmode>,
  document.getElementById('root')
);
